We finally got a diagnosis for Marionberry. She has a sliding hiatal hernia. We are attempting a more aggressive approach with medications and in two weeks if she’s still symptomatic we’ll talk to the surgeon about next steps. Sliding hiatal hernias are rare in cats and this is the last thing we had on our list of possibilities. I’m anticipating she will need surgery based on the severity of her symptoms and how little she’s responded to these medications before. The estimate for surgery is $2k-$4,500. Please consider helping out our problem child. All I can hope for is to be able to give her the life she deserves.

@shelbyskittensafehouse is a 501(c)3 and your donations are tax deductible. 

